// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.5.16 <0.6.0;

contract SignContract {
     struct userDetails {
     string pdfHash;
     string contractorName;
     string signerName;
     string signedPdfHash;
     }
     mapping(address => userDetails) public Users;

    function storeContract(string memory _pdfhash , string memory _contractorName) public {
       Users[msg.sender].pdfHash = _pdfhash;
       Users[msg.sender].contractorName = _contractorName;
    }

    function storeSignedContract(address _contractor, string memory _singerName, string memory _signedPdfHash) public {
       Users[_contractor].signerName = _singerName;
       Users[_contractor].signedPdfHash = _signedPdfHash;
    }
   function retrieve(address _address) public view returns (string memory, string memory){
        string memory pdfHashIs = Users[_address].pdfHash;
        string memory contractorName = Users[_address].contractorName;
        return (pdfHashIs, contractorName);
    }
}
